<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>

<script>
    function calculateTotalSales() {
    let total = 0;
    document.querySelectorAll('#salesTable tbody tr').forEach(row => {
        const totalCell = row.querySelector('td:nth-child(5)');
        if (totalCell) {
            const value = parseFloat(totalCell.textContent.replace(/[^0-9.-]+/g, ''));
            if (!isNaN(value)) total += value;
        }
    });
    return total.toFixed(2);
}
   function downloadPDF() {
    const element = document.getElementById('salesTable');

    const noPrintElements = document.querySelectorAll('.no-print');
    noPrintElements.forEach(el => el.style.display = 'none');

    html2canvas(element).then((canvas) => {
        
        const imgData = canvas.toDataURL('image/png');
        const { jsPDF } = window.jspdf;
        const pdf = new jsPDF('p', 'mm', 'a4');

        const pageWidth = pdf.internal.pageSize.getWidth();
        let y = 10;

        const logoBase64 = "data:image/png;base64,";

        pdf.addImage(logoBase64, 'PNG', 10, y, 30, 30);

        // Store Name & Address
        pdf.setFontSize(16);
        pdf.text("Apollo XIII Store", 45, y + 10);
        pdf.setFontSize(10);
        pdf.text("Tacloban City, Leyte", 45, y + 16);

        // Current Date
        const today = new Date();
        const formattedDate = today.toLocaleDateString();
        pdf.text(`Date: ${formattedDate}`, pageWidth - 50, y + 10);

        y += 35; // Move down after header

        // Add table
        const imgWidth = pageWidth - 20;
        const imgHeight = canvas.height * imgWidth / canvas.width;
        pdf.addImage(imgData, 'PNG', 10, y, imgWidth, imgHeight);

        // Calculate total sales
        const totalSales = calculateTotalSales();
        const totalY = y + imgHeight + 10;

        pdf.setFontSize(12);
        pdf.setTextColor(0, 0, 0);
        pdf.text(`Total Sales: P${totalSales}`, 10, totalY);

        pdf.save(`sales-report-${formattedDate}.pdf`);

        noPrintElements.forEach(el => el.style.display = '');
    });
}
</script>